import styled from "styled-components"


export const Header = styled.div`
    background: red;
    height: 64px;
    align-items: center;
    justify-content: center;
    display: flex;
`;

export const Container = styled.div`
    background: #FFFFFF;
`;

export const HeaderButtonLeft = styled.button`
    margin-left: 10px;
    left: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;

export const HeaderButtonRight = styled.button`
    margin-right: 10px;
    right: 10px;
    border-radius: 10px;
    border: none;
    position: absolute;
`;
export const Image = styled.image`
   position: absolute;
    width: 289px;
    height: 288px;
    left: 43px;
    top: 122px;
`;
